import React from 'react'

function SalaryButton({salary , incrementSalary , children}) {
  console.log(`Render ${children} Button`);
  return (
    <>
    <button onClick={() => incrementSalary}>{children}</button>
    <p>{salary}</p>
    </>
  )
}

export default SalaryButton
